package frontweb.homework_vo;

public class Emp5 {
	int deptno;
	int count;
	double avg;
	public Emp5() {
		// TODO Auto-generated constructor stub
	}
	public Emp5(int deptno, int count, double avg) {
		this.deptno = deptno;
		this.count = count;
		this.avg = avg;
	}
	public int getDeptno() {
		return deptno;
	}
	public void setDeptno(int deptno) {
		this.deptno = deptno;
	}
	public int getCount() {
		return count;
	}
	public void setCount(int count) {
		this.count = count;
	}
	public double getAvg() {
		return avg;
	}
	public void setAvg(double avg) {
		this.avg = avg;
	}
}
